import React from 'react';
import { IconButton } from '@material-ui/core';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';



const IconUser = ({title}) =>{
  return    <IconButton>
                <AccountCircleIcon />  
                <p> {title} </p>
            </IconButton>
}
export default IconUser;
